import React, { useEffect, useState } from 'react'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

//Componunt
import NavBar from './componunts/NavBar.jsx'
//Pages
import Home from './pages/Home.jsx'

import {DarkModeProvider} from './customeHooks/DarkModeContext.jsx'


function App() {
  return (
    <DarkModeProvider>
      <header className="w-100 bg-white">
        <NavBar />
      </header>
      <main className={`container`}>
        <Home />
      </main>
    </DarkModeProvider>
  );
}

export default App;
